import React from 'react';
import { Row } from 'react-bootstrap';
import AccountCard from './account-card';

const AccountList = ({ accounts, closeAccount, setState }) => (
  <Row>
    {accounts.map(account => (
      <AccountCard key={account.accountId} account={account} closeAccount={closeAccount} setState={setState} />
    ))}
  </Row>
);

export default AccountList;
